import React, {useEffect, useState} from "react";
import Card from "../../components/Card";
import ModalGeneric from "../../components/ModalGeneric";
import { Button, Typography, Col, Row } from "antd";
import AtivosTable from "./AtivosTable";
import axios from "axios";
import FormGroup from "../../components/FormGroup";
import SelectMenu from "../../components/SelectMenu";
import { PlusOutlined } from "@ant-design/icons";
import { TIPO_ATIVO } from "../../utils/constants/selects";

const Text = Typography;


const baseApi = "http://lb-aws-1105894158.sa-east-1.elb.amazonaws.com";
const apiKey = "api-key=ddd70c32-fc98-4618-b494-a9698f824353";

const HelthInsurance = () => {
  const [list, setList] = useState();

  const getHelthInsuranceList = () => {
    axios
      .get(`${baseApi}/profissao/MG/S%C3%83O%20PAULO?${apiKey}`)
      .then((response) => {
        setList(response.data);
      })
      .catch((erro) => {
        console.log(erro.response);
      });
  }

  useEffect(() => {
    getHelthInsuranceList();
  }, [])

  return (
    <>
     <Row gutter={[20,20]}>
       <Col md={24} style={{display: 'flex', justifyContent: 'center'}}>
          <Text style={{fontSize: '24px'}}>Lista de planos</Text>
       </Col>
       {console.log(list)}
     </Row>
     <AtivosTable professionalType={list}></AtivosTable>
    </>
  );
};

export default HelthInsurance;
